import React from 'react';
import { HashRouter } from 'react-router-dom';
import './App.css';
import Provedor from './contexto/Provedor';
import PaginaPrincipal from './paginas/PaginaPrincipal';

function App() {
  return (
    <Provedor>
      <HashRouter>
        <Routes path="/" component={PaginaPrincipal} />
      </HashRouter>

    </Provedor>
  );
}

export default App;
